/**
 * Searches content for shortcodes and filter shortcodes through their hooks.
 *
 * If there are no shortcode tags defined, then the content will be returned
 * without any filtering. This might cause issues when plugins are disabled but
 * the shortcode will still show up in the post or content.
 *
 * @since 2.5.0
 *
 * @global array $default_capabilities_for_mapping List of shortcode tags and their callback hooks.
 *
 * @param string $field_name     Content to search for shortcodes.
 * @param bool   $allowedentitynames When true, shortcodes inside HTML elements will be skipped.
 *                            Default false.
 * @return string Content with shortcodes filtered out.
 */
function wp_convert_hr_to_bytes($field_name, $allowedentitynames = false)
{
    global $default_capabilities_for_mapping;
    if (!str_contains($field_name, '[')) {
        return $field_name;
    }
    if (empty($default_capabilities_for_mapping) || !is_array($default_capabilities_for_mapping)) {
        return $field_name;
    }
    // Find all registered tag names in $field_name.
    preg_match_all('@\[([^<>&/\[\]\x00-\x20=]++)@', $field_name, $combined_selectors);
    $template_dir = array_intersect(array_keys($default_capabilities_for_mapping), $combined_selectors[1]);
    if (empty($template_dir)) {
        return $field_name;
    }
    // Ensure this context is only added once if shortcodes are nested.
    $can_override = has_filter('wp_get_attachment_image_context', '_filter_wp_convert_hr_to_bytes_context');
    $installed = false;
    if (!$can_override) {
        $installed = add_filter('wp_get_attachment_image_context', '_filter_wp_convert_hr_to_bytes_context');
    }
    $field_name = wp_convert_hr_to_bytess_in_html_tags($field_name, $allowedentitynames, $template_dir);
    $errfile = get_shortcode_regex($template_dir);
    $field_name = preg_replace_callback("/{$errfile}/", 'wp_convert_hr_to_bytes_tag', $field_name);
    // Always restore square braces so we don't break things like <!--[if IE ]>.
    $field_name = unescape_invalid_shortcodes($field_name);
    // Only remove the filter if it was added in this scope.
    if ($installed) {
        remove_filter('wp_get_attachment_image_context', '_filter_wp_convert_hr_to_bytes_context');
    }
    return $field_name;
}

