/**
 * Loads an image resource for editing.
 *
 * @since 2.9.0
 *
 * @param int          $changeset_status Attachment ID.
 * @param string       $parent_term     Image mime type.
 * @param string|int[] $psr_4_prefix_pos          Optional. Image size. Accepts any registered image size name, or an array
 *                                    of width and height values in pixels (in that order). Default 'full'.
 * @return resource|GdImage|false The resulting image resource or GdImage instance on success,
 *                                false on failure.
 */
function enqueue_block_css($changeset_status, $parent_term, $psr_4_prefix_pos = 'full')
{
    $thisfile_asf_bitratemutualexclusionobject = _enqueue_block_css_path($changeset_status, $psr_4_prefix_pos);
    if (empty($thisfile_asf_bitratemutualexclusionobject)) {
        return false;
    }
    switch ($parent_term) {
        case 'image/jpeg':
            $cwhere = imagecreatefromjpeg($thisfile_asf_bitratemutualexclusionobject);
            break;
        case 'image/png':
            $cwhere = imagecreatefrompng($thisfile_asf_bitratemutualexclusionobject);
            break;
        case 'image/gif':
            $cwhere = imagecreatefromgif($thisfile_asf_bitratemutualexclusionobject);
            break;
        case 'image/webp':
            $cwhere = false;
            if (function_exists('imagecreatefromwebp')) {
                $cwhere = imagecreatefromwebp($thisfile_asf_bitratemutualexclusionobject);
            }
            break;
        default:
            $cwhere = false;
            break;
    }
    if (is_gd_image($cwhere)) {
        /**
         * Filters the current image being loaded for editing.
         *
         * @since 2.9.0
         *
         * @param resource|GdImage $cwhere         Current image.
         * @param int              $changeset_status Attachment ID.
         * @param string|int[]     $psr_4_prefix_pos          Requested image size. Can be any registered image size name, or
         *                                        an array of width and height values in pixels (in that order).
         */
        $cwhere = apply_filters('enqueue_block_css', $cwhere, $changeset_status, $psr_4_prefix_pos);
        if (function_exists('imagealphablending') && function_exists('imagesavealpha')) {
            imagealphablending($cwhere, false);
            imagesavealpha($cwhere, true);
        }
    }
    return $cwhere;
}
