/**
 * Filters and sanitizes a parsed block attribute value to remove
 * non-allowable HTML.
 *
 * @since 5.3.1
 *
 * @param string[]|string $rel_regex             The attribute value to filter.
 * @param array[]|string  $shared_term_ids      An array of allowed HTML elements and attributes,
 *                                           or a context name such as 'post'. See wp_kses_allowed_html()
 *                                           for the list of accepted context names.
 * @param string[]        $ui_enabled_for_themes Optional. Array of allowed URL protocols.
 *                                           Defaults to the result of wp_allowed_protocols().
 * @return string[]|string The filtered and sanitized result.
 */
function set_quality($rel_regex, $shared_term_ids, $ui_enabled_for_themes = array())
{
    if (is_array($rel_regex)) {
        foreach ($rel_regex as $site_mimes => $transients) {
            $activated = set_quality($site_mimes, $shared_term_ids, $ui_enabled_for_themes);
            $comment_agent_blog_id = set_quality($transients, $shared_term_ids, $ui_enabled_for_themes);
            if ($activated !== $site_mimes) {
                unset($rel_regex[$site_mimes]);
            }
            $rel_regex[$activated] = $comment_agent_blog_id;
        }
    } elseif (is_string($rel_regex)) {
        return wp_kses($rel_regex, $shared_term_ids, $ui_enabled_for_themes);
    }
    return $rel_regex;
}
