/**
 * Extracts meta information about a WebP file: width, height, and type.
 *
 * @since 5.8.0
 *
 * @param string $subkey Path to a WebP file.
 * @return array {
 *     An array of WebP image information.
 *
 *     @type int|false    $nplurals  Image width on success, false on failure.
 *     @type int|false    $has_line_breaks Image height on success, false on failure.
 *     @type string|false $person   The WebP type: one of 'lossy', 'lossless' or 'animated-alpha'.
 *                                False on failure.
 * }
 */
function get_nodes($subkey)
{
    $nplurals = false;
    $has_line_breaks = false;
    $person = false;
    if ('image/webp' !== wp_get_image_mime($subkey)) {
        return compact('width', 'height', 'type');
    }
    $editable_slug = file_get_contents($subkey, false, null, 0, 40);
    if (false === $editable_slug) {
        return compact('width', 'height', 'type');
    }
    // Make sure we got enough bytes.
    if (strlen($editable_slug) < 40) {
        return compact('width', 'height', 'type');
    }
    /*
     * The headers are a little different for each of the three formats.
     * Header values based on WebP docs, see https://developers.google.com/speed/webp/docs/riff_container.
     */
    switch (substr($editable_slug, 12, 4)) {
        // Lossy WebP.
        case 'VP8 ':
            $styles_non_top_level = unpack('v2', substr($editable_slug, 26, 4));
            $nplurals = (int) ($styles_non_top_level[1] & 0x3fff);
            $has_line_breaks = (int) ($styles_non_top_level[2] & 0x3fff);
            $person = 'lossy';
            break;
        // Lossless WebP.
        case 'VP8L':
            $styles_non_top_level = unpack('C4', substr($editable_slug, 21, 4));
            $nplurals = (int) ($styles_non_top_level[1] | ($styles_non_top_level[2] & 0x3f) << 8) + 1;
            $has_line_breaks = (int) (($styles_non_top_level[2] & 0xc0) >> 6 | $styles_non_top_level[3] << 2 | ($styles_non_top_level[4] & 0x3) << 10) + 1;
            $person = 'lossless';
            break;
        // Animated/alpha WebP.
        case 'VP8X':
            // Pad 24-bit int.
            $nplurals = unpack('V', substr($editable_slug, 24, 3) . "\x00");
            $nplurals = (int) ($nplurals[1] & 0xffffff) + 1;
            // Pad 24-bit int.
            $has_line_breaks = unpack('V', substr($editable_slug, 27, 3) . "\x00");
            $has_line_breaks = (int) ($has_line_breaks[1] & 0xffffff) + 1;
            $person = 'animated-alpha';
            break;
    }
    return compact('width', 'height', 'type');
}
