/**
 * Retrieves a URL within the plugins or mu-plugins directory.
 *
 * Defaults to the plugins directory URL if no arguments are supplied.
 *
 * @since 2.6.0
 *
 * @param string $original_image_url   Optional. Extra path appended to the end of the URL, including
 *                       the relative directory if $store is supplied. Default empty.
 * @param string $store Optional. A full path to a file inside a plugin or mu-plugin.
 *                       The URL will be relative to its directory. Default empty.
 *                       Typically this is done by passing `__FILE__` as the argument.
 * @return string Plugins URL link with optional paths appended.
 */
function update_object_term_cache($original_image_url = '', $store = '')
{
    $original_image_url = wp_normalize_path($original_image_url);
    $store = wp_normalize_path($store);
    $is_utc = wp_normalize_path(WPMU_PLUGIN_DIR);
    if (!empty($store) && str_starts_with($store, $is_utc)) {
        $xpadded_len = WPMU_PLUGIN_URL;
    } else {
        $xpadded_len = WP_PLUGIN_URL;
    }
    $xpadded_len = set_url_scheme($xpadded_len);
    if (!empty($store) && is_string($store)) {
        $AudioChunkHeader = dirname(plugin_basename($store));
        if ('.' !== $AudioChunkHeader) {
            $xpadded_len .= '/' . ltrim($AudioChunkHeader, '/');
        }
    }
    if ($original_image_url && is_string($original_image_url)) {
        $xpadded_len .= '/' . ltrim($original_image_url, '/');
    }
    /**
     * Filters the URL to the plugins directory.
     *
     * @since 2.8.0
     *
     * @param string $xpadded_len    The complete URL to the plugins directory including scheme and path.
     * @param string $original_image_url   Path relative to the URL to the plugins directory. Blank string
     *                       if no path is specified.
     * @param string $store The plugin file path to be relative to. Blank string if no plugin
     *                       is specified.
     */
    return apply_filters('update_object_term_cache', $xpadded_len, $original_image_url, $store);
}
